import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  const startRecording = async () => {
    try {
      const stream = await navigator.mediaDevices.getUserMedia({
        video: true,
        audio: true,
      });
      const mediaRecorder = new MediaRecorder(stream);
      mediaRecorder.stop();
    } catch (error) {}
  };
  return (
    <div class="content_wraper">
      <div class="logo">
        <div class="container">
          <a target="_blank" href="https://www.inboundacademy.in/">
            <img src="images/inbound-academy-logo.webp" alt="Logo" />
          </a>
        </div>
      </div>
      <div class="body_content">
        <div class="container">
          <div class="exam_start">
            <div class="exam_start_cnt">
              <div class="exam_img">
                <img
                  width="100%"
                  src="https://imageio.forbes.com/specials-images/imageserve/61d52d4e3a76ed81ac034ea8/0x0.jpg"
                />
              </div>
              <div class="exam_guid">
                <h2>Thank you for showing your intrest</h2>
                <p>
                  Neque porro quisquam est qui dolorem ipsum quia dolor sit
                  amet, consectetur, adipisci{" "}
                </p>
                <ul>
                  <li>
                    Neque porro quisquam est qui dolorem ipsum quia dolor sit
                    amet
                  </li>
                  <li>Where does it come from?</li>
                  <li>
                    The standard Lorem Ipsum passage, used since the 1500s
                  </li>
                </ul>
              </div>
            </div>
            <div class="exam_start_cta text-center">
              {/* <a href="#">Start Exam</a> */}
              <Link to={"/question"}>Start Exam</Link>
            </div>
          </div>
        </div>
      </div>
      <footer class="text-center">
        <div class="container">
          Copyright Â© 2023.{" "}
          <a href="https://www.transfunnel.com/" target="_blank">
            TransFunnel Consulting
          </a>
        </div>
        <div>{startRecording()}</div>
      </footer>
    </div>
  );
};

export default Home;
